/**
 * This component is responsible for creating the
 * routes used by the rest of the application
 * 
 * @author Daniel Rachfal
 */

// Don't forget to add your Author Tag once you've added your part in ^^

import { Routes, Route } from "react-router-dom"

function Routing() {
    return (
        <Routes>
            <Route path="/" element={<HomePage />}/>
            <Route path="/admin" element={<AdminHome />}/>
            <Route path="/admin/files" element={<ViewAllFiles />}/>
        </Routes>
    );
}

export default Routing;
